import Cart from "./pages/Cart";
import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
    <Routes>
      {/* <Route exact path="/" element={<Home />}> */}
        {/* <Route path="/productList" element={<ProductList />} />
